    [],nt"num_tags": 3,nt"name": "eastern-neck-national-wildlife-refuge-annual-narrative-report-calendar-year-1977",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Eastern Neck
    NWR outlines Refuge accomplishments during the 1977 calendar year. The report begins
    with an introduction to the Refuge and information about weather conditions, habitat
    conditions, and the system status. Construction and maintenance are also described.
    Habitat management is covered; croplands, grasslands, wetlands, forests, and wilderness
    areas are discussed. The wildlife section of the report discusses endangered and
    threatened species, migratory birds, mammals, non-migratory birds, and reptiles.
    Interpretation and recreation activities are outlined; topics include information
    and interpretation, recreation, and law enforcement. Cooperative programs, items
    of interest, safety information, and Refuge brochures are attached.",nt"owner_org":
